class NumArray(object):
    def __init__(self, nums):
        """
        :type nums: List[int]
        """
        self.na =  [nums[0]]
        for i in range(1,len(nums)):
            self.na.append(self.na[-1] + nums[i])
        #print self.na

    def sumRange(self, i, j):
        """
        :type i: int
        :type j: int
        :rtype: int
        """
        if i == 0: return self.na[j]
        return self.na[j] - self.na[i-1]

